'use strict';

module.exports = function () {
  var cache = {};
  return {
    /**
     * @implements Cache.get
     * @param {string} url
     * @param {Function} callback
     */
    get: function get(url, callback) {
      callback(null, cache[url]);
    },

    /**
     * @implements Cache.set
     * @param {string} url
     * @param {string} response
     * @param {Function} callback
     */
    set: function set(url, response, callback) {
      cache[url] = response;
      callback();
    },

    /**
     * @implements Cache.purge
     * @param {string} url
     * @param {Function} callback
     */
    purge: function purge(url, callback) {
      delete cache[url];
      callback();
    }
  };
};
